import React from 'react';
import './layout-styles.css';

const Layout = ({ Image, Content }) => {
    return (
        <div className = "container">
            <div className = "app-title">Stack Chess</div>
            <div className="flex">
                <Image />
                <div className = "content">
                    <Content />
                </div>
            </div>
        </div>
    );
};
export default Layout;
